  {nameDir: 'папка1.1',   id: 2, parent: 0},
  {nameDir: 'папка2.2',   id: 3, parent: 1},
  {nameDir: 'папка2.1',   id: 4, parent: 1},
  {nameDir: 'папка1.1.1', id: 5, parent: 2},
];

const App = () =>{
console.log (listDir);
let newList =  listDir.map( name  => {
  if (name.parent===null) return <li>{name.nameDir}</li>});
  return (
    <div className="App">
      <ul><p>список</p>
      <li  key={Math.random()}>{newList}</li>
      </ul>
    </div>
  );
}


export default App;
